import React, { Component } from 'react'
import "./App.css"

export default class App extends Component {
  render() {
    return (
      <div className='main'>
        <video loop autoPlay muted className="bg-video">
            <source src={(require('./assets/Messaoudi.mp4'))}></source>
        </video>
        <div className='content'>
          <h2>Ciao.</h2>
          <h1>Sono Bilel,</h1>
          <h2>imprenditore digitale</h2>
        </div>
      </div>
    )
  }
}
